import React from "react";

function SkillCard(props){
    return(
        // main div 
        <div className="w-[20%] flex justify-evenly flex-row bg-[#635985] m-4 items-center">
            
            {/* icon image div  */}
            <div className=" w-[40%]">
                <img className="h-[70%]" src={props.icon} alt={props.title}></img>
            </div>
            {/* skill name div */}
            <div className="text-[#18122B] font-bold text-">
                {props.title}
            </div>

        </div>
    );
}

export default SkillCard;
